import { createSelector } from 'reselect';

export const getSelectedDatarunID = (state) => state.datarun.selectedDatarunID;

const getDatarun = state => state.datarun;
export const getSelectedTimePeriod = createSelector([getDatarun], (datarun) => datarun.selectedTimePeriod);
